import React from 'react'
import '../styles/App.css'

const TableHead = ({tableHeaders}) => {

  return (
    <div className="header">
      <div className="cell">
        <strong>
          {tableHeaders.map((tableHeader) => (
            <TableHead tableHeader={tableHeader} key={tableHeader.id} />
          ))}
        </strong>
      </div>
    </div>
  );
}

export default TableHead
